public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }
  TimelineExistsFilter other = (TimelineExistsFilter) obj;
  if (compareOp != other.compareOp) {
    return false;
  }
  if (value == null) {
    if (other.value != null) {
      return false;
    }
  } else if (!value.equals(other.value)) {
    return false;
  }
  return true;
}
